class Status {
    static NotSeen = new Status("جديد", "غير مقروء");
    static Seen = new Status("مقروء" , "قيد المراجعة");
    static Rejected = new Status("تم الرفض" , "مرفوض");
    static Accepted = new Status("تم المقبول" , "مقبول");
    constructor(ManagerMessage , EmployeeMessage){
        this.ManagerMessage = ManagerMessage;
        this.EmployeeMessage = EmployeeMessage;
    }
}
const inOrOutArray = ['داخل البلاد' , 'خارج البلاد']
const vacationTypesArray = ['سنوية' , 'رسمية' , 'مرضية' , 'زواج'  , 'أمومة' , 'بدون راتب' , 'حج' , 'وفاة قريب مباشر' , 'وفاة قريب غير مباشر']

export {
    Status, 
    inOrOutArray,
    vacationTypesArray,
}
